CREATE TABLE `bl_items` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `bl_id` int NOT NULL,
  `numero_item` int unsigned NOT NULL,
  `descripcion` text,
  `marcas` text,
  `carga_peligrosa` char(1) DEFAULT NULL,
  `tipo_bulto` varchar(10) DEFAULT NULL,
  `cantidad` int unsigned DEFAULT NULL,
  `peso_bruto` decimal(12,3) DEFAULT NULL,
  `unidad_peso` varchar(3) DEFAULT NULL,
  `volumen` decimal(12,2) DEFAULT NULL,
  `unidad_volumen` varchar(3) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uq_bl_item` (`bl_id`,`numero_item`),
  KEY `idx_bl_items_bl` (`bl_id`),
  CONSTRAINT `fk_bl_items_bl` FOREIGN KEY (`bl_id`) REFERENCES `bls` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1287 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
