  `sec` int DEFAULT NULL,
  `severidad` enum('ERROR','OBS') NOT NULL,
  `campo` varchar(50) NOT NULL,
  `mensaje` varchar(255) NOT NULL,
  `valor_crudo` varchar(255) DEFAULT NULL,
  `linea_pms` varchar(10) DEFAULT NULL,
  `codigo_pms` varchar(50) DEFAULT NULL,
  `raw_line` text,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `idx_bl` (`bl_id`),
  KEY `idx_bl_sev` (`bl_id`,`severidad`),
  KEY `idx_nivel` (`nivel`),
  CONSTRAINT `fk_bl_validaciones_pms_bl` FOREIGN KEY (`bl_id`) REFERENCES `bls` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1384 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
