CREATE TABLE `itinerarios` (
  `id` int NOT NULL AUTO_INCREMENT,
  `manifiesto_id` int NOT NULL,
  `puerto_id` int NOT NULL,
  `port_type` enum('LOAD','DISCHARGE') NOT NULL,
