  KEY `puerto_id` (`puerto_id`),
  CONSTRAINT `itinerarios_ibfk_1` FOREIGN KEY (`manifiesto_id`) REFERENCES `manifiestos` (`id`) ON DELETE CASCADE,
  CONSTRAINT `itinerarios_ibfk_2` FOREIGN KEY (`puerto_id`) REFERENCES `puertos` (`id`)
