/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `participantes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `codigo_bms` varchar(20) NOT NULL,
  `nombre` varchar(200) NOT NULL,
  `direccion` text,
  `ciudad` varchar(100) DEFAULT NULL,
  `pais` varchar(10) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `telefono` varchar(50) DEFAULT NULL,
  `rut` varchar(20) DEFAULT NULL,
  `contacto` varchar(100) DEFAULT NULL,
  `matchcode` varchar(50) DEFAULT NULL,
  `tiene_contacto_valido` tinyint(1) DEFAULT '0',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `codigo_almacen` varchar(20) DEFAULT NULL COMMENT 'Cdigo de almacn (ej: A-36) para ALM',
  PRIMARY KEY (`id`),
  UNIQUE KEY `codigo_bms` (`codigo_bms`)
) ENGINE=InnoDB AUTO_INCREMENT=2390 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
